import React from 'react';
import useGetListCurrentlyPlaying from '../../hooks/useGetListCurrentlyPlaying';
import { Avatar, List } from 'antd';
import { API_KEY } from '../../constants/api-keys';
function CurrentlyPlayingList(props) {
	const { loading, currentPlayingList } = useGetListCurrentlyPlaying(1);

	console.log(loading, currentPlayingList);
	return (
		<List
			grid={{
				gutter: 16,
				xs: 1,
				sm: 2,
				md: 4,
				lg: 4,
				xl: 12,
				// xxl: 3,
			}}
			itemLayout='horizontal'
			dataSource={currentPlayingList?.results}
			renderItem={(item) => (
				<List.Item>
					<List.Item.Meta
						avatar={<Avatar src={`${API_KEY.IMAGE_URL + item.poster_path}`} />}
						title={item.original_title}
						//   description="Ant Design, a design language for background applications, is refined by Ant UED Team"
					/>
				</List.Item>
			)}
		/>
	);
}

export default CurrentlyPlayingList;
